                <h3 class=""introduce"">　　健身運動在台灣漸漸普及後，很多人勤跑健身房後，身體變壯、結實了，但是看起來還是肉肉的。七分飲食三分運動，不管健身的目的是增肌減脂還是維持身體健康，飲食是達成目標的關鍵，健身新手最常犯的錯誤就是：只運動卻不控制飲食，尤其是剛接觸健身的女生，不是亂吃就是吃太少，這樣的做法可能越運動越胖，但也不是不吃垃圾食物如油炸、甜食等就會瘦下來，飲食種類不均衡一樣越減越胖。</h3>
